import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Inicio from '../../pages/Inicio/inicio';
import Body from '../Body/Body';
import Navbar from '../Header/Navbar/Navbar';


const Main = () => {

    return (
        <div>
            <BrowserRouter>
                <Navbar/>
                <Body/>
            </BrowserRouter>
            
        </div>
    )
}

export default Main;
